import React from "react";
import Form from 'react-bootstrap/Form';

import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import { FormControl, FormLabel } from "@mui/material";
import { MuiThemeProvider, createMuiTheme } from 'material-ui/styles'

import "./signup.css"

const redTheme = createMuiTheme({ palette: { primary: red } })

const SignUp=()=>{

return(
    <>
    
    <Box
      component="form"
     
      
      sx={{
        "& .MuiTextField-root": { m: 1, width: "65ch" },marginTop:"50px"
      }}
    //   noValidate
    //   autoComplete="off"
      style={{ textAlign: "center",color:"red" }}
      
    >
      <h1 style={{ textAlign: "center",color:"red" }}>Signup form</h1>

        <div>
          <FormControl>
            {/* <FormLabel style={{textAlign:"left"}}>Enter First name:</FormLabel> */}
            <TextField
              required
              id="filled-required"
              label="Enter First name"
              //    defaultValue="Hello World"
              variant="filled"
             
            />
          </FormControl>
        </div>

        <div>
          <FormControl>
            {/* <FormLabel style={{textAlign:"left"}}>Enter Last name:</FormLabel> */}
            <TextField
              required
              id="filled-required"
              label="Enter Last name"
              //    defaultValue="Hello World"
              variant="filled"
             
            />
          </FormControl>
        </div>

        <div>
          <FormControl>
            {/* <FormLabel style={{textAlign:"left"}}>Enter Email:</FormLabel> */}
            <TextField
              required
              id="filled-required"
              label="Enter Email"
              //    defaultValue="Hello World"
              variant="filled"
             type="email"

            />
          </FormControl>
        </div>


        <div>
          <FormControl>
            {/* <FormLabel style={{textAlign:"left"}}>Enter password</FormLabel> */}
            <TextField
            required
              id="filled-password-input"
              label="Enter password"
              type="password"
              // autoComplete="current-password"
              variant="filled"
              
            />
          </FormControl>
        </div>
        <div>
        <FormControl>
        <MuiThemeProvider theme={redTheme}>
        <Button variant="outlined" color="error" type="submit">
        Submit
      </Button>
      
      </MuiThemeProvider>
        </FormControl>
        
        </div>
      {/* </form> */}
    </Box>
   
    </>
)
}


export default SignUp;
